import React from 'react';
import Filter from "../Filter/filter";
import {Link} from 'react-router-dom';
import {Nav,Row,Col} from 'react-bootstrap'
import classes from './navbar.module.css';

const Navbar = ({screen}) => {
    const filterOption = () => {
        document
            .querySelector(".FilterOption")
            .classList
            .toggle("hide");
        console.log("filterOption");
    };
    return (
        <Row className='bg-dark'>
            <Col sm={6}>
                <Nav fill variant="tabs" defaultActiveKey="/home">
                    <Nav.Item>
                        <Nav.Link className={classes.Navlink} href="/">Nearest rides</Nav.Link>
                    </Nav.Item>
                    <Nav.Item>
                        <Nav.Link eventKey="link-1">Upcoming rides(4)</Nav.Link>
                    </Nav.Item>
                    <Nav.Item>
                        <Nav.Link eventKey="link-2">Past rides (3)</Nav.Link>
                    </Nav.Item>
                </Nav>
            </Col>
        </Row>

    // <div className="Nav">   <div className="nav">     <Link to="/">       <p
    // className={screen == "NearestRides" ? "active" : ""}>         Nearest rides
    //     </p>     </Link>     <Link to="/upcoming-rides/">       <p
    // className={screen == "UpcomingRides" ? "active" : ""}>         Upcoming rides
    // (3)       </p>     </Link>     <Link to="/past-rides/">       <p
    // className={screen == "PastRides" ? "active" : ""}>         Past rides (3)
    //   </p>     </Link>   </div>   <div className="filter" onClick={filterOption}>
    //     <img src="../img/sort.svg" alt="sort" />     <p>Filters</p>   </div>
    // <Filter /> </div>
    );
};

export default Navbar;
